    render() {
        return (
            <div>
                <Tabs defaultActiveKey="inBox" id="uncontrolled-tab-example">
                <Tab eventKey="inBox" title="육아고민 상담">
                   
                </Tab>
                <Tab eventKey="course" title="진로고민 상담">
                   
                </Tab>
            </Tabs>
            </div>
        );
    }
}

export default Marketing;
